import React, { Component } from 'react';
import { render } from 'react-dom';
import Filters from './containers/Filters';
import './style.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      name: 'React'
    };
  }

  render() {
    return (
      <div class="filters-container">
        <Filters />
      </div>
    );
  }
}

render(<App />, document.getElementById('root'));
